        <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
            <h1>Sistem Identifikasi Penyakit Padi</h1>
            <FileUpload />
            <hr style={{ margin: "20px 0" }} />
            <CameraAccess />
        </div>
    );
}

export default App;
